icon = b''
default_bg = b''
# Template
transflag = b''
if __name__ == "__main__":
    new_res = ""
    import base64

    with open("../icon.ico", "rb") as icon:
        re_icon = base64.b64encode(icon.read())
        new_res += "icon = " + str(re_icon) + "\n"

    with open("../bg.png", "rb") as default_bg:
        re_bg = base64.b64encode(default_bg.read())
        new_res += "default_bg = " + str(re_bg) + "\n"

    start_template = False
    for line in open("Resource.py", "rb"):
        if start_template:
            new_res += line.decode("utf-8")
        elif line == b'# Template\n':
            start_template = True
            new_res += line.decode("utf-8")

    with open("Resource.py", "wb") as selffile:
        selffile.write(new_res.encode("utf-8"))

def release_img():
    open("../bg.png", "wb").write(base64.b64decode(default_bg))
    open("../icon.ico", "wb").write(base64.b64decode(icon))
